	private String apiURL11 = "http://hit2.nimbus.cip.gatech.edu/HIESvc/HIE.svc/SendMessage";
	private String apiURL88 = "http://hit2.nimbus.cip.gatech.edu/HIESvc/HIE.svc/GetMedication?PatientID=";

