	/**
	 * The content provider class is responsible for providing objects to the
	 * view. It can wrap existing objects in adapters or simply return objects
	 * as-is. These objects may be sensitive to the current input of the view,
	 * or ignore it and always show the same content (like Task List, for
	 * example).
	 */
	class ViewContentProvider implements IStructuredContentProvider {
		public void inputChanged(Viewer v, Object oldInput, Object newInput) {
		}

		public void dispose() {
		}

		public Object[] getElements(Object parent) {
			if (parent instanceof Object[]) {
				return (Object[]) parent;
			}
	        return new Object[0];
		}
	}

	class ViewLabelProvider extends LabelProvider implements
			ITableLabelProvider {
		public String getColumnText(Object obj, int index) {
			return getText(obj);
		}

		public Image getColumnImage(Object obj, int index) {
			return getImage(obj);
		}

		public Image getImage(Object obj) {
			return PlatformUI.getWorkbench().getSharedImages().getImage(
					ISharedImages.IMG_OBJ_ELEMENT);
		}
	}

	/**
	 * This is a callback that will allow us to create the viewer and initialize
	 * it.
	 */
	public void createPartControl(Composite parent) {
		c = new DefaultHttpClient();  
		toolkit = new FormToolkit(parent.getDisplay());
		form = toolkit.createScrolledForm(parent);
		form.setText("Test HIE APIs");
		TableWrapLayout layout1 = new TableWrapLayout();
		form.getBody().setLayout(layout1);
		
		Section section = toolkit.createSection(form.getBody(), Section.DESCRIPTION
		        | Section.TITLE_BAR | Section.TWISTIE);
		    section.setText("Send Alert Message"); //$NON-NLS-1$
		    section.setDescription("This demonstrates the usage of SendMessage API");
		
		    TableWrapData twd1 = new TableWrapData(TableWrapData.FILL_GRAB,TableWrapData.FILL_GRAB);
		    section.setLayoutData(twd1);
	    Composite client = toolkit.createComposite(section, SWT.WRAP);
	    TableWrapLayout layout = new TableWrapLayout();
	    layout.numColumns = 2;
	    client.setLayout(layout);
	    TableWrapData twd = new TableWrapData(TableWrapData.FILL_GRAB,TableWrapData.FILL_GRAB);
	    client.setLayoutData(twd);
	    
	    toolkit.createLabel(client, "Physician Id:");
	    userid = toolkit.createText(client, "1008");	    
	    toolkit.createLabel(client, "Patient Id:");
	    patientid = toolkit.createText(client, "1392");	    
	    toolkit.createLabel(client, "Subject:");
	    subject = toolkit.createText(client, "Testing HIE SendMessage");
	    toolkit.createLabel(client, "Message:");
	    msg = toolkit.createText(client, "Patients health conditions");
	    toolkit.createLabel(client, "Priority:");
	    priority = toolkit.createText(client, "High");
	    
	    sendmsg = toolkit.createButton(client, "Send Alert Message", SWT.PUSH);
	    sendmsg.addSelectionListener(new SelectionAdapter() {
	    	@Override
	    	public void widgetSelected(SelectionEvent e) {
	    		try {
					HttpPost p = new HttpPost(apiURL11);
					JSONObject json = new JSONObject();
					json.put("PatientID", patientid.getText());
					json.put("RecipientID", userid.getText());
					json.put("Subject", subject.getText());
					json.put("Body", msg.getText());
					json.put("Priority", "1");
					StringEntity input = new StringEntity( json.toString());
					System.out.println(json.toString());
					input.setContentType("application/json");
					p.setEntity(input);
					HttpResponse r = c.execute(p);
					BufferedReader rd = new BufferedReader(new InputStreamReader(r.getEntity().getContent()));
					String line = null;
					while ((line = rd.readLine()) != null) {
						System.out.println(line);
					}
					Shell lShell = PlatformUI.getWorkbench().getActiveWorkbenchWindow().getShell();
					MessageDialog.openInformation(lShell,"Success","Sent the alert message to physician"); 
					
				} catch (Exception e1) {
					// TODO Auto-generated catch block
					e1.printStackTrace();
				}
	    	}
		});
	    
	    section.setClient(client);
	    
	    Section section2 = toolkit.createSection(form.getBody(), Section.DESCRIPTION
		        | Section.TITLE_BAR | Section.TWISTIE);
		    section2.setText("Send Patient Report"); //$NON-NLS-1$
		    section2.setDescription("This demonstrates the usage of SendReport API");
		
		    TableWrapData twd2 = new TableWrapData(TableWrapData.FILL_GRAB,TableWrapData.FILL_GRAB);
		    section.setLayoutData(twd2);
	    Composite client2 = toolkit.createComposite(section2, SWT.WRAP);
	    TableWrapLayout layout2 = new TableWrapLayout();
	    layout2.numColumns = 2;
	    client2.setLayout(layout2);
	    TableWrapData twd22 = new TableWrapData(TableWrapData.FILL_GRAB,TableWrapData.FILL_GRAB);
	    client2.setLayoutData(twd22);
	    
	    toolkit.createLabel(client2, "Patient Id:");
	    patientid2 = toolkit.createText(client2, "1392");	    
	    toolkit.createLabel(client2, "Report Name:");
	    docname = toolkit.createText(client2, "Test report");
	    Composite client3 = toolkit.createComposite(client2, SWT.WRAP);
	    TableWrapData twd3 = new TableWrapData(TableWrapData.FILL_GRAB,TableWrapData.FILL_GRAB);
	    twd3.colspan=2;
	    client3.setLayoutData(twd3);
	    TableWrapLayout layout3 = new TableWrapLayout();
	    layout3.numColumns = 3;
	    client3.setLayout(layout3);
	    toolkit.createLabel(client3, "Upload File:");
	    msg = toolkit.createText(client3, "SP-800-66-Revision1.pdf");
	    browse = toolkit.createButton(client3, "Browse", SWT.PUSH);
	    browse.addSelectionListener(new SelectionAdapter() {
	    	@Override
	    	public void widgetSelected(SelectionEvent e) {
	    		Shell lShell = PlatformUI.getWorkbench().getActiveWorkbenchWindow().getShell();
		    	FileDialog dlg = new FileDialog(lShell,SWT.OPEN);
		    	String fn = dlg.open();
		        if (fn != null) {
		          msg.setText(fn);
		        }
	    	}
		});
	    
	    sendreport = toolkit.createButton(client2, "Send Patient Report", SWT.PUSH);
	    sendreport.addSelectionListener(new SelectionAdapter() {
	    	@Override
	    	public void widgetSelected(SelectionEvent e) {
	    		try {
					HttpPost p = new HttpPost(apiURL10);
					JSONObject json = new JSONObject();
					json.put("PatientID", patientid.getText());
					json.put("DocumentName", docname.getText());
					json.put("Base64Document", "");
					json.put("DocumentFileType","4");
		            json.put("DocumentTypeID","17");
					StringEntity input = new StringEntity( json.toString());
					System.out.println(json.toString());
					input.setContentType("application/json");
					p.setEntity(input);
					HttpResponse r = c.execute(p);
					BufferedReader rd = new BufferedReader(new InputStreamReader(r.getEntity().getContent()));
					String line = null;
					while ((line = rd.readLine()) != null) {
						System.out.println(line);
					}
					Shell lShell = PlatformUI.getWorkbench().getActiveWorkbenchWindow().getShell();
					MessageDialog.openInformation(lShell,"Success","Uploaded the patient report"); 
					
				} catch (Exception e1) {
					// TODO Auto-generated catch block
					e1.printStackTrace();
				}
	    	}
		});
	    
	    section2.setClient(client2);
	}

